    std::unordered_map<long long, long long> unique_prime_factors(long long k, size_t limit = 0)
    {
        std::unordered_map<long long, long long>r;
        if (is_prime(k)) {r[k]++; return r;}

        long long t = k;
        for (long long i = 2; i <= t; i++)
        {
            if (t == 1) break;
            if (is_prime(i))
            {
                while(t % i == 0)
                {
                    r[i]++;
                    t = t/i;

                    if (limit > 0)
                        if (r.size() > limit) return r;
                }
            }
        }
        return r;
    }

