    long long sumofFactors(long long n)
    {
        // Traversing through all prime factors.
        long long res = 1;
        long long k = n;
        for (long long i = 2; i <= sqrt(n); i++)
        {
            long long curr_sum = 1;
            long long curr_term = 1;
            while (n % i == 0)
            {
                // THE BELOW STATEMENT MAKES
                // IT BETTER THAN ABOVE METHOD
                //  AS WE REDUCE VALUE OF n.
                n = n / i;

                curr_term *= i;
                curr_sum += curr_term;
            }

            res *= curr_sum;
        }

        // This condition is to handle
        // the case when n is a prime
        // number greater than 2.
        if (n >= 2)
            res *= (1 + n);

        return res - k;
    }

    long long countDivisors(long long n)
    {
        long long cnt = 0;
        for (long long i = 1; i*i <= n; i++) {
            if (n % i == 0) {
                // If divisors are equal,
                // count only one
                if (n / i == i)
                    cnt++;

                else // Otherwise count both
                    cnt = cnt + 2;
            }
        }
        return cnt;
    }

    long long middle_divisor(long long n)
    {
        if (n <= 1) return 1;
        if (is_prime(n)) return 1;

        long double d = (long double)n;
        long long sqn = (long long)std::sqrt((long double)d);
        if (sqn == 0) return 1;

        for (long long i = sqn; i >= 1; i--)
        {
            if (n % i == 0)
            {
                return i;
            }
        }
        return 1;
    }

    std::vector<long long>  middle_divisors(long long n)
    {
        if (n<=0)  std::cerr << "ERROR in middle_divisors argument" << n << std::endl;
        if (n<=0) throw std::logic_error("ERROR in middle_divisors argument");
        if (n<=0) return {1,1};
        long long a = middle_divisor(n) ;
        long long b = n/a;
        if (a<=b) return {a, b};
        return {b, a};
    }

